import React, { Component } from 'react';
import Link from "next/link";

const NavMenu = () => {
    return (
        
        <div className="container-fulid shadow-sm rounded">
            <style jsx>{`
                font-family:  Impact, sans-serif;
                font-size: 18px;             
            `}</style>

            <nav className="navbar-expand-lg bg-dark fixed-top">
                <div className="container text-center">
                    <div className="d-flex justify-content-center">
                         
                        <Link href={'https://www.youtube.com/channel/UCTiawqM9Dokq3vm9snbKi9A'}>
                            <a className="mr-2" target="_blank"><img src="/static/images/social/youtube.png" alt="image" /></a>                                            
                         </Link>


                        <a className="nav-item nav-link" href="/about">ABOUT</a>
                        <a className="nav-item nav-link" href="/about">PATREON</a>                        
                    </div>  
                </div>             
            </nav>











            
      </div>
    );
  }


export default NavMenu;
